const axios = require('axios');

const getCountriesByCountry = (handleSuccess, countryId) => {
    axios.get(`http://localhost:8000/cities/${countryId}`)
    .then(success => {
        handleSuccess(success.data)
    }).catch(error => console.log(error))
} 

export {getCountriesByCountry};
